import react from "react";
import Title from "./Title";
import LogOut from "./buttons/logout";
import WriteArea from "./notebook components/WriteArea";
function Notebook(){
   const date = new Date();
   const fullDate = date.getDate +'-'+date.getMonth+'-'+date.getFullYear;
 
return(
    <div>
        <div className="TitleBar">
            <div>
            <Title/>
            </div>
            <div className="buttonBox">
                <LogOut/>
            </div>
        
        </div>
        {/* <h2>whats on your mind</h2> */}
        {/* <WriteArea/> */}
        <div className="TextWriting">
            <h2 className="Gratitude">Hi!, how have you been?</h2>
            <div className="form-group">
                <input type="email" class="form-control" id="exampleFormControlInput1" placeholder={fullDate} />
            </div>
            <textarea  rows="8" cols="60" className="TextArea form-control" placeholder="Content"></textarea>
            <button className="submit btn btn-dark">Submit</button>
        </div>

    </div>);
}
export default Notebook;
